import React from 'react';
import { Scatter } from 'react-chartjs-2';

const data = {
  datasets: [
    {
      label: 'Song Popularity vs. Duration',
      data: [
        { x: 2.5, y: 30 },
        { x: 3.5, y: 50 },
        { x: 4, y: 60 },
        { x: 5, y: 80 },
        { x: 5.5, y: 90 },
        { x: 6, y: 95 },
        { x: 7, y: 80 },
        { x: 7.5, y: 70 },
        { x: 8.5, y: 50 },
        { x: 9.5, y: 30 },
      ],
      backgroundColor: '#1DB954',
    },
  ],
};

const options = {
  scales: {
    xAxes: [
      {
        type: 'linear',
        position: 'bottom',
        scaleLabel: {
          display: true,
          labelString: 'Duration (minutes)',
        },
        ticks: {
          min: 0,
          max: 10,
        },
      },
    ],
    yAxes: [
      {
        scaleLabel: {
          display: true,
          labelString: 'Popularity (out of 100)',
        },
        ticks: {
          min: 0,
          max: 100,
        },
      },
    ],
  },
};

const ScatterPlot = () => {
  return <Scatter data={data} options={options} />;
};

export default ScatterPlot;
